import styled from "styled-components";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faInstagram,
  faTwitterSquare,
  faMedium,
} from "@fortawesome/free-brands-svg-icons";

const Contact = () => {
  return (
    <Container>
      <FontAwesomeIcon
        icon={faInstagram}
        style={{
          border: "2.5px solid skyblue",
          fontSize: "64px",
          maxWidth: "80%",
        }}
        color="aliceblue"
        aria-hidden="true"
      />
      <FontAwesomeIcon
        icon={faTwitterSquare}
        style={{ fontSize: "64px" }}
        color="aliceblue"
        aria-hidden="true"
      />
      <FontAwesomeIcon
        icon={faMedium}
        style={{ fontSize: "64px" }}
        color="aliceblue"
        aria-hidden="true"
      />
    </Container>
  );
};

export default Contact;

const Container = styled.div`
  border: 5px solid skyblue;
  border-radius: 50px;
  box-shadow: 20px 20px black;
  display: flex;
  flex-flow: column nowrap;
  align-items: flex-start;
  justify-content: space-evenly;
  min-height: 1000px;
  min-width: 1100px;
  max-width: 50%;
`;
